import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

import Logo from '../Assets/Logo.png';
import Team from '../Assets/Logo.png';

const Home: React.FC = () => {
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');

    if (!token) {
      navigate('/');
    }
  }, [navigate]);

  return (
    <div className="homepage">

      <header className="header">
        <div>
          <nav className="nav">
            <img src={Logo} alt="Logo" className="logo" />
            <button className="login-btn">Login</button>
          </nav>
        </div>
        <div></div>
        <div></div>
      </header>

      <main>
        <section className="project-description">
          <h1>Project description</h1>

        </section>

        <section className="Our team">
          <h1>Fremium</h1>

        </section>

        {/* Présentation de l'équipe */}
        <section className="team-section">
          <h2>Notre Équipe</h2>
          <div className="team-container">
            <img src={Team} alt="Notre équipe" className="team-image" />
            <p>Nous sommes une équipe de passionnés dans [domaine du projet]. Chaque membre apporte son expertise pour mener à bien cette initiative.</p>
          </div>
        </section>
      </main>

      <footer className="footer">
        <p>&copy; 2024 Nom du Projet. Tous droits réservés.</p>
      </footer>
    </div>
  );
};

export default Home;
